func (p *ecorePackageImpl) initializePackageContents() {
	// Initialize package
	p.SetName(NAME)
	p.SetNsPrefix(NS_PREFIX)
	p.SetNsURI(NS_URI)

	// Add supertypes to classes
	p.eAnnotation.GetESuperTypes().Add(p.GetEModelElement())
	p.eAttribute.GetESuperTypes().Add(p.GetEStructuralFeature())
	p.eClass.GetESuperTypes().Add(p.GetEClassifierClass())
	p.eClassifier.GetESuperTypes().Add(p.GetENamedElement())
	p.eDataType.GetESuperTypes().Add(p.GetEClassifierClass())
	p.eEnum.GetESuperTypes().Add(p.GetEDataType())
	p.eEnumLiteral.GetESuperTypes().Add(p.GetENamedElement())
	p.eFactory.GetESuperTypes().Add(p.GetEModelElement())
	p.eNamedElement.GetESuperTypes().Add(p.GetEModelElement())
	p.eOperation.GetESuperTypes().Add(p.GetETypedElement())
	p.ePackage.GetESuperTypes().Add(p.GetENamedElement())
	p.eParameter.GetESuperTypes().Add(p.GetETypedElement())
	p.eReference.GetESuperTypes().Add(p.GetEStructuralFeature())
	p.eStructuralFeature.GetESuperTypes().Add(p.GetETypedElement())
	p.eTypeParameter.GetESuperTypes().Add(p.GetENamedElement())
	p.eTypedElement.GetESuperTypes().Add(p.GetENamedElement())

	p.initializeEAnnotationContent()
	p.initializeEAttributeContent()
	p.initializeEClassContent()
	p.initializeEClassifierContent()
	p.initializeEDataTypeContent()
	p.initializeEEnumContent()
	p.initializeEEnumLiteralContent()
	p.initializeEFactoryContent()
	p.initializeEGenericTypeContent()
	p.initializeEModelElementContent()
	p.initializeENamedElementContent()
	p.initializeEObjectContent()
	p.initializeEOperationContent()
	p.initializeEPackageContent()
	p.initializeEParameterContent()
	p.initializeEReferenceContent()
	p.initializeEStringToStringMapEntryContent()
	p.initializeEStructuralFeatureContent()
	p.initializeETypeParameterContent()
	p.initializeETypedElementContent()
	p.initializePackageEDataTypes()
}

